잘 쓰고 있어요^^ 완전 초보라 선생님이 추천해주신걸로 구입했는데,
러버도 정확하게 붙혀주시고 확인문자까지 꼼꼼히 보내주셨어요♡
잘 쓰고 있구요, 열심히 연습해서 초보 탈출해볼게요^^;

탁구는 초보이고, 중학교 체육수업시간에 쓰는 용으로, 티모볼 2000과 3000으로 고민하다가 좀 더 비싼건 이유가 있겠지~싶어서, 티모볼 3000으로 구매했습니다. 러버도 단단히 잘 붙어있고, 마감도 깔끔합니다. 무게도 적당하고, 아이손에도 잘 맞습니다.
고무냄새가 좀 많이 나서 냄새 좀 없어지라고 베란다에 뒀더니, 고무에 먼지가 많이 붙어서 역효과였네요,,^^;;
많이 찾아봤는데, 여기가 가장 저렴했습니다.

제품좋습니다 친절히 전화도 주시고 꼼꼼하게 잘 완성해 보내주셨는데 아이가 바로 학교에 가져가는 바람에 사진을 못 찍었네요;;
한가지 아쉬운건 탁구채와 가방에서 냄새가 좀 나는 편이나 탈취제뿌렸더니 없어지긴 하는 듯 합니다
좋은 제품 보내주셔서 감사합니다~!
